import logo from './logo.svg';
import './App.css';

function App() {
  function Text(props){
    return(
      <div> <p> Text {props.name} </p></div>)
  }
  return (
    <div className="App">
     <h1> Test </h1>
     <Text name={"John"}/>
    </div>
  );
}

export default App;
